import React, { useRef } from "react";
import girl from "./ photos/girl.jpg";
import girl2 from "./ photos/girl2.jpg";

function App() {
  return (
    <div className="img-container flex-row">
      <img src={girl} />
      <img src={girl2} />
    </div>
  );
}

export default App;
